import React from "react";

function Error404() {
  const style = {
    backgroundColor: "black",
    // background: "transparent",
    color: "white",
    fontColor: "white",
    fontSize: "3rem",
    // textAlign: "center",
    width: "50%",
    padding: "1rem",
  };
  return <h1 style={style}>Page not found</h1>;
}

export default Error404;
